import React from 'react';
import ReactDOM from 'react-dom';

var time = new Date();
time = time.getHours();
let greet = "";

if(time >=6 && time <12){
    greet = "Good Morning";
}else if(time >=12 && time <17){
    greet = "Good Afternoon"
}else if (time >=17 && time <20){
    greet = "Good Evening"
}else{
    greet = "Good Night"
}



ReactDOM.render(
<>
<h1 idName='hi'>
    Hello Sir, {greet}
</h1>

</>
